from typing import List
import time

class Solution:
    def increasingTriplet(self, nums: List[int]) -> bool:
        n = len(nums)
        i = 0
        j = i+1
        k = j+1
        while i < n and j < n and k < n:
            print(str(nums[i]) + " " + str(nums[j]) + " " + str(nums[k]) + "\n")
            if nums[i] < nums[j] < nums[k]:
                return True
            if nums[i] >= nums[j]:
                i = j
                j = i + 1
                k = j + 1
            elif nums[i] >= nums[k] and nums[j] > nums[k]:
                k += 1
            elif nums[j] >= nums[k]:
                j = k
                k = j + 1

            print(str(i) + " " + str(j) + " " + str(k))
        return False


